import React from 'react';

import styles from './ProjectListItem.module.css';

function ProjectListItem(props) {
    return (
    <div className={styles.project} id="project1">
        <p className={styles["project-title"]}>{"Empty" || props.project.name}</p>
        <img alt="Project" className={styles["project-img"]} src={props.projectImage}/>
        <p className={styles["project-tags"]}>Tags: {"None" || [...props.project.tags]}</p>
    </div>
    );
};

export default ProjectListItem;
